void UNIX_SettingsDefineCapabilities::clearInstance()
{

	_groupComponent = CIMInstance(CIMName("CIM_RedundancySetCapabilities"));
	_partComponent = CIMInstance(CIMName("CIM_FirewallRuleSettingData"));
	_propertyPolicy = Uint16(0);
	_valueRole = Uint16(0);
	_valueRange = Uint16(0);

}

Boolean UNIX_SettingsDefineCapabilities::loadInstance(const CIMInstance &instance)
{
	clearInstance();
	Uint32 propertyCount = instance.getPropertyCount();
	for(Uint32 i = 0; i < propertyCount; i++) {
		CIMConstProperty property = instance.getProperty(i);
			if (String::equal(property.getName().getString(), "GroupComponent"))
			{
				CIMInstance groupComponentValue;
				property.getValue().get(groupComponentValue);
				setGroupComponent(groupComponentValue);
			}
			else if (String::equal(property.getName().getString(), "PartComponent"))
			{
				CIMInstance partComponentValue;
				property.getValue().get(partComponentValue);
				setPartComponent(partComponentValue);
			}
			else if (String::equal(property.getName().getString(), "PropertyPolicy"))
			{
				Uint16 propertyPolicyValue;
				property.getValue().get(propertyPolicyValue);
				setPropertyPolicy(propertyPolicyValue);
			}
			else if (String::equal(property.getName().getString(), "ValueRole"))
			{
				Uint16 valueRoleValue;
				property.getValue().get(valueRoleValue);
				setValueRole(valueRoleValue);
			}
			else if (String::equal(property.getName().getString(), "ValueRange"))
			{
				Uint16 valueRangeValue;
				property.getValue().get(valueRangeValue);
				setValueRange(valueRangeValue);
			}
	}
	return true;
}


